import React from 'react';
import * as S from './HeaderStyles'; // Ajuste o caminho conforme sua estrutura
import { NavLink } from 'react-router-dom';

const HeaderLogin = () => {
  return (
    <S.HeaderLogin>
      <S.Title>Iphones do Nairobi</S.Title>
      <NavLink to="/produtos" style={{ textDecoration: 'none' }}>
        <S.Subtitle>
          <i
            className="pi pi-lock"
            style={{ color: "white", fontSize: "2.0rem" }}
          ></i>
          100% Seguro
        </S.Subtitle>
      </NavLink>
    </S.HeaderLogin>
  );
};

export default HeaderLogin;
